import * as React from 'react';
import { ChartContainer, BarPlot } from '@mui/x-charts';
import { axisClasses } from '@mui/x-charts';
import Stack from '@mui/material/Stack';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Radio from '@mui/material/Radio';

const dataset = [
  {
    status: 'Activities',
    New: 0,
    InProgress: 0,
    Done: 0,
    NotDoingIt: 0,
  },
];

const valueFormatter = (value: number | null) => `${value}`;

export default function MyBars({ data }: { data: any[] }) {
  const getStatusCounts = () => {
    const counts = {
      New: 0,
      InProgress: 0,
      Done: 0,
      NotDoingIt: 0,
    };

    data.forEach((activity) => {
      switch (activity.status) {
        case 'new':
          counts.New++;
          break;
        case 'inprogress':
          counts.InProgress++;
          break;
        case 'done':
          counts.Done++;
          break;
        case 'notdoingit':
          counts.NotDoingIt++;
          break;
        default:
          break;
      }
    });

    return counts;
  };

  const counts = getStatusCounts();

  const uData = [counts.New, counts.InProgress, counts.Done, counts.NotDoingIt];
  const xLabels = ['New', 'InProgress', 'Done', 'NotDoingIt'];

  const [tickPlacement, setTickPlacement] = React.useState<
    'start' | 'end' | 'middle' | 'extremities'
  >('middle');
  const [tickLabelPlacement, setTickLabelPlacement] = React.useState<
    'middle' | 'tick'
  >('middle');

  return (
    <div style={{ width: '100%' }}>
      <Stack direction="column" justifyContent="space-between" sx={{ width: '100%' }}>
        <FormControl>
          <FormLabel id="tick-placement-radio-buttons-group-label">
            tickPlacement
          </FormLabel>
          <RadioGroup
            row
            aria-labelledby="tick-placement-radio-buttons-group-label"
            name="tick-placement"
            value={tickPlacement}
            onChange={(event) =>
              setTickPlacement(
                event.target.value as 'start' | 'end' | 'middle' | 'extremities',
              )
            }
          >
            <FormControlLabel value="start" control={<Radio />} label="start" />
            <FormControlLabel value="end" control={<Radio />} label="end" />
            <FormControlLabel value="middle" control={<Radio />} label="middle" />
            <FormControlLabel
              value="extremities"
              control={<Radio />}
              label="extremities"
            />
          </RadioGroup>
        </FormControl>
        <FormControl>
          <FormLabel id="label-placement-radio-buttons-group-label">
            tickLabelPlacement
          </FormLabel>
          <RadioGroup
            row
            aria-labelledby="label-placement-radio-buttons-group-label"
            name="label-placement"
            value={tickLabelPlacement}
            onChange={(event) =>
              setTickLabelPlacement(event.target.value as 'tick' | 'middle')
            }
          >
            <FormControlLabel value="tick" control={<Radio />} label="tick" />
            <FormControlLabel value="middle" control={<Radio />} label="middle" />
          </RadioGroup>
        </FormControl>
      </Stack>
      <ChartContainer
        width={500}
        height={300}
        series={[{ data: uData, label: 'Activities', type: 'bar', valueFormatter }]}
        xAxis={[
          {
            scaleType: 'band',
            data: xLabels,
            tickPlacement,
            tickLabelPlacement,
          },
        ]}
        sx={{
          [`& .${axisClasses.directionY} .${axisClasses.label}`]: {
            transform: 'translateX(-10px)',
          },
        }}
      >
        <BarPlot />
      </ChartContainer>
    </div>
  );
}
